, invoking a timeless dreamscape. Flitting, multilayered images of vocalist/bassist Kedra, ordered estate gardens, a blooming tropical solarium, and scenes rushing past a setting sun in an anonymous train's window are all set against lush guitars and ethereal vocals. The off-hand glamour and mystery of the repeated images reinforce the song's soaring, swirling atmosphere and stay in the mind like pictures from a dream half-remembered upon waking. Amidst tour dates on the East Coast and in the Midwest, The Morelings began recording their first full-length album with Philadelphia producer Jeff Zeigler (Nothing, A Sunny Day in Glasgow).","isMobileFriendly":"false","image":null,"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"http://www.themorelings.com","urlMySpace":"","urlFacebook":"https://www.facebook.com/themorelings","urlTwitter":"http://twitter.com/themorelings","twitterScreenName":"themorelings"}],"urlEventDetailsUrl":"http://thefire.ticketfly.com/event/1384600?utm_medium=api"}]}
